  for (i = 0; i <= k; i++) {
    f2_data[i] = Fs_sound * f2_data[i] / sound_length;
  }
  /*  stem(f2,P12) */
  a = 0.0;
  y = 0.0;
  /* finding min and max frequency index (b/w 1 and 4) for ppg */
  k = 0;
  exitg1 = false;
  while ((!exitg1) && (k <= f->size[1] - 1)) {
    a = f_data[k];
    if (f_data[k] >= 1.0) {
      a = (double)k + 1.0;
      /*  min frequency index */
      exitg1 = true;
    } else {
      k++;
    }
  }
  k = 0;
  exitg1 = false;
  while ((!exitg1) && (k <= f->size[1] - 1)) {
    y = f_data[k];
    if (f_data[k] >= 4.0) {
      y = (double)k + 1.0;
      /*  max frequency index */
      exitg1 = true;
    } else {
      k++;
    }
  }
  if (a > y) {
    i = -1;
    i1 = 0;
    i2 = 0;
  } else {
    i = (int)a - 2;
    i1 = (int)a - 1;
    i2 = (int)y;
  }
  /* plot(chunk_f, chunk_p1) */
  k = i2 - i1;
  for (i2 = 0; i2 < k; i2++) {
    P1_data[i2] = P1_data[i1 + i2];
  }
  iv[0] = 1;
  iv[1] = k;
  maximum(P1_data, iv, &ai, &iindx);
  /* finding min and max frequency index (b/w 1 and 4) for sound */
  k = 0;
  exitg1 = false;
  while ((!exitg1) && (k <= f2->size[1] - 1)) {
    a = f2_data[k];
    if (f2_data[k] >= 1.0) {
      a = (double)k + 1.0;
      exitg1 = true;
    } else {
      k++;
    }
  }
  k = 0;
  exitg1 = false;
  while ((!exitg1) && (k <= f2->size[1] - 1)) {
    y = f2_data[k];
    if (f2_data[k] >= 4.0) {
      y = (double)k + 1.0;
      exitg1 = true;
    } else {
      k++;
    }
  }
  if (a > y) {
    i1 = -1;
    i2 = 0;
    i3 = 0;
  } else {
    i1 = (int)a - 2;
    i2 = (int)a - 1;
    i3 = (int)y;
  }
  /* plot(chunk_f2, chunk_p12) */
  k = i3 - i2;
  P12_size[1] = k;
  P12_size[0] = 1;
  for (i3 = 0; i3 < k; i3++) {
    P22[i3] = P12_data[i2 + i3];
  }
  maximum(P22, P12_size, &ai, &k);
  /* the previous value would be multiplied by 0.3 when running in loop */
  ai = rt_roundd_snf(
      (0.4 * (f_data[i + iindx] * 60.0) + 0.3 * (f2_data[i1 + k] * 60.0)) +
      rt_roundd_snf(0.4 * (double)previous_bpm));
  emxFree_real_T(&f2);
  emxFree_real_T(&f);
  if (ai < 65536.0) {
    if (ai >= 0.0) {
      heartbeat = (unsigned short)ai;
    } else {
      heartbeat = 0U;
    }
  } else if (ai >= 65536.0) {
    heartbeat = MAX_uint16_T;
  } else {
    heartbeat = 0U;
  }
  /*  complementary filter */
  return heartbeat;
